const std = @import("std");
const w4 = @import("../wasm4.zig");
const Self = @This();

const Scene = @import("Scene.zig");
const Controller = @import("../Controller.zig");
const Reader = @import("../DialogueReader.zig");
const String = []const u8;

const fade_out_time = 120;
const fade_out_steps = fade_out_time / (fade_through.len);
const fade_through = [_]u16{
    0x2341,
    0x3341,
    0x3342,
    0x4343,
    0x4444,
};

const scenes = [_]Scene{
    Scene.init_comptime(@embedFile("intro.txt"), .{
        .intro_img = &panel_1,
        .evil_rhombus = &panel_2,
        .sacred_flames = &panel_3,
    }),
    Scene.init_comptime(@embedFile("fight.txt"), .{
        .fight_img = &panel_4,
    }),
};

from: enum(u4) {
    main_menu,
    labyrinth,
    boss_fight,
},

init_next: bool = true,
slide: [*]const u8 = undefined,
reader: Reader = .{},
fade_outer: u16 = 0,
sequence_itr: usize = 0,

pub fn update(self: *Self, controller: Controller) bool {
    const scene = scenes[@enumToInt(self.from)];

    if (self.sequence_itr >= scene.items.len) {
        return true;
    }

    const seq = scene.items[self.sequence_itr];

    // init sequence
    if (self.init_next) {
        switch (seq) {
            .new_slide => |v| {
                self.slide = v;
                self.fade_outer = fade_out_time;
            },
            .text => |v| {
                self.reader = Reader{
                    .readhead = v,
                };
            },
        }
        self.init_next = false;
    }

    // update sequences
    switch (seq) {
        .new_slide => {
            if (self.fade_outer > 0) {
                self.fade_outer -= 1;
            } else {
                self.sequence_itr += 1;
                self.init_next = true;
            }
        },
        .text => {
            if (!self.reader.update(controller)) {
                self.fade_outer += 1;
                if (self.fade_outer >= fade_out_time) {
                    self.sequence_itr += 1;
                    self.init_next = true;
                    self.fade_outer = fade_out_time - 1;
                }
            }
        },
    }

    w4.DRAW_COLORS.* = 0x44;
    w4.rect(0, 0, 160, 160);

    const fade = self.fade_outer / fade_out_steps;

    w4.DRAW_COLORS.* = fade_through[fade];
    w4.blit(self.slide, 20, 20, 120, 120, w4.BLIT_2BPP);

    self.reader.draw();

    return false;
}

